طريقه الاستعمال مع الدرمابن
توضع الماده على جميع البشره وتترك لتجف بعدها توضع كميه على المنطقه الي رح تبدين بيها لدرمابن وتشتغلين بلجهاز عليها وهكذا الى ان تكملين كل الوجه 

